import React, { Component } from "react";
import "@fortawesome/fontawesome-free/css/all.min.css";
import "bootstrap-css-only/css/bootstrap.min.css";
import "mdbreact/dist/css/mdb.css";
import "./client.css";
import Search from "./search";
import Footer from "../footer/footer";

import {
  MDBBtn,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBCardTitle,
  MDBCardText,
  MDBRow,
  MDBCol,
  MDBIcon,
} from "mdbreact";
import { MDBContainer, MDBRating } from "mdbreact";
import Searche from "./search";
import Footerclient from "../footer/footer";
import Navbar from "../navbar/navbar";

const Platjour = () => {
  return (
    <div>
     <div className="containent">
        <Navbar />
        <Searche />
      </div>

      <div className="cardes">
        <MDBRow>
          <MDBCol md="4">
            <MDBCard cascade>
              <MDBCardImage
                cascade
                className="img-fluid"
                overlay="white-light"
                hover
                src="https://femmesdetunisie.com/wp-content/uploads/2015/12/Borghol.jpg"
              />
            <ModalPage ></ModalPage>
              <MDBCardBody cascade>
                <MDBCardTitle>Coucous bl 3alouch</MDBCardTitle>
                <hr />
                <MDBCardText>
                  <MDBCardText>Ingredient </MDBCardText>
                  3alouch, felfel a7mer, kosksi smid, hrissa,zit zitouna
                </MDBCardText>
                <MDBCardText>8 TND</MDBCardText>
              </MDBCardBody>

              <div className="rounded-bottom mdb-color lighten-3 text-center pt-3">
                <center>
                  {" "}
                  <div className="white-text"> Soliman abeul</div>
                </center>
              </div>
            </MDBCard>
          </MDBCol>
        </MDBRow>
  </div> 
      <Footer />
    </div>
  );
};

export default Platjour;
